import React from "react";
import "./MusicPage.css";

const MusicPage = () => {

  const Spotify = () => {
    var element = document.getElementById("new");
    
  }
    return (
        <>
          {(
            
             
                <div id="space">
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="welcome"> WELCOME TO MY MUSIC PORTAL </div>
                    <div className="title"> MUSIC MOODZ </div>
                    <div className="caption">Choose a mood from the cards below for the perfect playlist</div> 
                    {/* <ReactPlayer url = "https://open.spotify.com/playlist/2n5JJJkFQMlmdYOsopsd8n?si=d9494a42af77457c"> */}
                    {/* <a style={{border:"12px"}} href="https://open.spotify.com/embed/playlist/2n5JJJkFQMlmdYOsopsd8n?utm_source=generator&theme=0" target="_blank" rel="noreferrer" width="100%" height="380" frameBorder="0" allowFullScreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy"> */}
                    <div id="playlist1">
                      <button type="button" className="box" onClick={Spotify}> BEGIN</button>
                    </div>
                   
                    {/* </a> */}
                    {/* </ReactPlayer> */}
                     
                </div>
                
              
            
          )}
        </>
    )
}

export default MusicPage
